import React, { Component } from 'react';
import { Card } from 'semantic-ui-react';
import cineasta from '../pictures/cineasta.gif'

class Projects extends Component {
  render() {
    return (
      <div>
        <Card
        image='/images/avatar/large/elliot.jpg'
          href='#http://terroirbioetnaturel.com/'
          header='Terroir Bio et Naturel'
          meta='Environnement technique : React.js, SCSS, Node.js / mySQL, GitHub'
          description='Objectif : réaliser un site web responsive avec un back-office pour une cliente'
        />
        <Card
        image='/images/avatar/large/elliot.jpg'
          href='#https://writerdays.herokuapp.com/'
          header='Writer Days (mobile)'
          meta='Friend'
          description='Site mobile réalisé durant le hackathon (3 jours) de la 5ième édition de la Spartan Week visant à mettre en relation les street-artistes et les particuliers, 2ième place remporté !'
        />
        <Card
        image='{cineasta}'
          href='#https://guarded-atoll-35875.herokuapp.com/'
          header='Cineasta'
          meta='Environnement technique : React.js, CSS, GitHub, Heroku'
          description=''
        />
      </div>
    );
  }
}

export default Projects;
